    const{key,product_name,description,img,tag,price}=product;
    return (
        <div>
            <div className="service">
                <h6>{tag}</h6>
             <img className="w-100 image" src={img} alt="" />
            <div className="details">
            <h5>{product_name}</h5>
            <h5>$ {price}</h5>
            {/* <Link to={`/details/${key}`}>
            <Button className="btn btn-light text-primary">Add To Cart</Button>
            </Link> */}
            </div>
           
        </div>
        </div>
    );
};

export default Review;
